import * as React from 'react';
import './CourseworkTabs.css';
import Tabs from '../../mui_components/Tabs.js'
import Tab from '../../mui_components/Tab.js'

function CourseworkTabs(props) {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div>
      <Tabs
          className='coursework-tabs'
          value={value} 
          onChange={handleChange} 
          variant='scrollable' 
          centered
        >
        <Tab label="Comp Sci" />
        <Tab label="Elec/Comp Engr" />
        <Tab label="Finance" />
        <Tab label="Business" />
        <Tab label="IBE" />
        <Tab label="General" />
      </Tabs>
      <CustomTabPanel value={value} index={0}>
        Item One
      </CustomTabPanel>
      <CustomTabPanel value={value} index={1}>
        Item Two
      </CustomTabPanel>
      <CustomTabPanel value={value} index={2}>
        Item Three
      </CustomTabPanel>
  </div>
  );
}

export default CourseworkTabs;
